import {Container, Card } from 'react-bootstrap';


function ThirdPage(){
        console.log("Third Page");
        console.log();
    return (<div>
        <Container fluid>
            <Card style = {{color: '#000'}}>
            <Card.Img src = 'https://picsum.photos/id/237/1000/500'/>
            <Card.Body>
                <Card.Title>
                Welcome 
                </Card.Title>
                <Card.Body>
                    Your Email : <br/>
                    Your Password : <br/>
                </Card.Body>
            </Card.Body>
            </Card>
        </Container>
    </div>);
}

export default ThirdPage;
